import React from "react";
import "./Card.css";
const Card = props => {
  return (
    <div className="card" style={{ width: "10rem", margin: "0 2.5em 0 2.5em" }}>
      <img
        src={props.image}
        className="card-img-top"
        alt="shabuMenu"
        style={{ height: "197px", transition: "transform .2s" }}
      ></img>
      <div className="card-body">
        <p
          className="card-text"
          style={{
            fontSize: "1.5rem",
            textAlign: "center"
          }}
        >
          {props.text}
        </p>
      </div>
    </div>
  );
};
export default Card;
